            <Container className=' border border-secondary flex-center fs-5 rounded m-0 p-0'><FaFacebookMessenger /></Container>
            <Container className=' border border-secondary flex-center fs-5 rounded m-0 p-0'><FaEnvelope/></Container>
        </div>



    </div>
  )
}

export default Footer
